import React, { Component } from 'react';
import  './Layout'

class Layout extends Component {

    render() {
        return (
            <div id="main">
                <header>
                    <div className='home'>
                        <a href="/" >Home</a>
                    </div>
                    <div className='sine'>
                        <a href="/register" >Register</a>
                        <a href="/login" >Login</a> 
                    </div>   
                </header>
                
                {this.props.children}
            </div>
        )
    }

}

export default Layout;
